  // let { timesRight, timesWrong, bestOf, lastGuessCorrect, computerGuess } = this.props
  let { timesRight, timesWrong, bestOf, lastGuessCorrect } = fakeProps

  return (
    <div
      id="feedback"
      role="status"
      aria-live="assertive"
      aria-atomic="true"
    >
      <h2>
        Win or Lose: {winOrLose}
      </h2>
      <h2>
        Computer guessed {fakeProps.computerGuess} you were {feeback}
